import React from "react";
import { TextField, Grid, Paper,Avatar } from "@mui/material";
// import LockIcon from '@mui/icons-material/Lock';

export function Login() {
const paperStyle = {padding :20,height :"70vh" , width :280 , margin :"20px auto" ,}
  return (
    <div>
      <h1>login page</h1>
      <div>
        <Grid>
          <Paper elevation ={10} style={paperStyle}>
            <Grid>
              <Avatar></Avatar>
            </Grid>
        
              <TextField variant="standard" label="Username" /><br/><br/>
              <TextField variant="outlined" label="Email" type="email" /><br/>
              <TextField variant="filled" label="Password" type="password" />
            
          </Paper>
        </Grid>
      </div>
    </div>
  );
}
